import React from "react";
import { Redirect } from "react-router-dom";
import {
  DashboardContainer,
  Dashboard,
  DashBoardContent,
  DashboardNav,
  DashboardList,
  DashboardListItem,
} from "./AdminProfileElements.js";

export const AdminProfile = ({ authorized }) => {
  if (!authorized) {
    return <Redirect to="/LogIn" />;
  }

  const nom = localStorage.getItem("nom");
  const prenom = localStorage.getItem("prenom");
  return (
    <DashboardContainer>
      <h1>
        Bienvenue {nom} {prenom}
      </h1>
      <Dashboard>
        <DashboardNav>
          <DashboardList>
            <DashboardListItem></DashboardListItem>
            <DashboardListItem></DashboardListItem>
          </DashboardList>
        </DashboardNav>
        <DashBoardContent></DashBoardContent>
      </Dashboard>
    </DashboardContainer>
  );
};
export default AdminProfile;
